function dxdt=differential(t,X,A,B,C) 
% This is replication dynamic equations in the three-player evolutionary game.
dxdt=zeros(3,1);
dxdt(1)= X(1)*(X(1) - 1)*((1 - C(4))*X(3)*A(3)*A(5)*A(7) - X(3)*A(2)*A(8) - X(3)*A(2)*A(7) + (1 - C(4))*X(3)*A(3)*A(5)*A(8) + (C(4) - 1)*X(3)*A(3)*A(7) + (C(4) - 1)*X(3)*A(3)*A(8) + (-B(9))*X(2)*A(2) + (1 - C(4))*A(3)*A(5) + (A(4) - A(6) - A(4)*A(9))*A(5));
dxdt(2) = -X(2)*(X(2)-1)*(B(5)-B(3)*B(4)+B(2)*B(11)+B(7)*B(8)-B(2)*B(11)*X(1)+B(3)*B(4)*B(6)*X(3));
dxdt(3) = -X(3)*(X(3)-1)*(C(5)-(-A(8))*A(3)*A(5)*C(4)-(-A(7)-A(8))*A(3)*A(5)*X(1)-A(8)*A(3)*A(5)-(-A(7)-A(8))*A(3)*C(4)*X(1)-A(8)*A(3)*C(4)-(A(7)+A(8))*A(3)*X(1)-(-A(8))*A(3)-(A(7)+A(8))*A(2)*X(1)-(-A(8))*A(2)-(B(3)*B(4)*B(6)-C(7)*B(10)-C(5)*B(10))*X(2)-(A(7)+A(8))*A(3)*A(5)*C(4)*X(1)-C(2)+C(7));
end